import {View ,Text} from "react-native"


export const Page1=({navigation})=>{
    return(
        <View>
        <Text>Hello We are in Page 1</Text>
        <Button title="Go To Page 2"
    onPress={()=>{navigation.push("Page2")}}
    />
        </View>

    )
}
